import React,{useEffect,Fragment} from 'react'
import "./Filter.css";

const Filter = ({ langs, active, onClickHandler }) => {
  const navbar=(<div className="col-xs-12 navbar nav-justified">
    <ul className="nav-justified"></ul></div>);
  const btnFilter = langs.map(lang => {
    return (
      <button
        key={lang}
        onClick={() => onClickHandler(lang)}
        className={active === lang ? "active" : ""}
      >
        {lang}
      </button>
    );
  });
  return <div className="col-xs-12 navbar nav-justified">
  <ul className="nav-justified">{btnFilter}</ul></div>;
};

export default Filter;
